class CustomerPage extends React.Component {
    render() {
        return (
            <div className="containeCustomer">
                <div className="backgroundCustomer" />
                <div className="contentCustomer">
                    <button src="icons/previous.png"/>
                    <button src="icons/next.png"/>
                </div>
            </div>
        );
    }
}

export default CustomerPage;
